import React from "react";
import { connect } from "react-redux";
import { isAuth } from "../../../Redux/Reducers/userReducer.js";
import ProfileMain from "./ProfileMain.jsx";
class ProfileMainContainer extends React.Component {
  render() {
    return (
      <ProfileMain
        username={this.props.state.username}
        isAuth={this.props.state.isAuth}
      />
    );
  }
}

const mapStateToProps = (state) => {
  return {
    state: state.user,
  };
};
const mapDispatchToProps = (dispatch) => {
  return {
    isAuth: (value) => dispatch(isAuth(value)),
  };
};
export default connect(
  mapStateToProps,
  mapDispatchToProps
)(ProfileMainContainer);
